import React, { useState, useEffect } from 'react';

import { useNavigate, useLocation } from 'react-router-dom';

import backButton from '../img/backButton.svg'
import menuButton from '../img/menuButton.svg'

import '../css/Profile.css';

const Profile = () => {

    // States
    const [summaryData, setSummaryData] = React.useState(null);
    const [allTransactionData, setAllTransactionData] = React.useState(null);
    const [importantEventsData, setImportantEventsData] = React.useState(null);
    const [allEvents, setAllEventsData] = React.useState(null);

    // Import fake data
    const fetchData = () => {
        setSummaryData(require('../data/outputs_176211_summarystats.json'));
    }

    const location = useLocation()
    const { CUID } = location.state

    const navigate = useNavigate();

    const directResult = () => {
        navigate('/result');
    }

    useEffect(() => {
        fetchData();
      }, []);

    return (
        <div>            
            {/* Title Section */}
            <div className="profile-title">
                {/* Back button */}
                <div className="back-button-content">
                    <button className="back-button" onClick={directResult}>
                            <img src={backButton} className="back-button-icon"/>
                            <p className="back-title"><strong>Back to result</strong></p>
                    </button>
                </div>


                {/* Titles */}
                <h1 className="heading-one mt-4"><strong>Name</strong></h1>
                <p className="heading-small-title"><strong> {CUID}  | EMAIL</strong></p>
            </div>

            {/* Profile Content */}
            <div className="profile-content-background">
                <div className="profile-content-row">
                    <div className="profile-sidebar">

                    </div>


                    <div className="profile-information">
                        {/* Summary */}
                        <h2>Summary</h2>
                        <p>This donor in this month has:</p>

                        <div className="summary-cards">
                            <div className="summary-card">
                                <h2 className="summary-card-title"><strong>Sent 7 emails</strong></h2>
                                <p className="summary-card-desc"><strong>25% increase from previous month</strong></p>
                            </div>

                            <div className="summary-card">
                                <h2 className="summary-card-title">Saw 8 banner eds</h2>
                                <p className="summary-card-desc">35% increase from previous month</p>
                            </div>

                            <div className="summary-card">
                                <h2 className="summary-card-title">Gifted 10 times</h2>
                                <p className="summary-card-desc">54% increase from previous month</p>
                            </div>

                            <div className="summary-card">
                                <h2 className="summary-card-title">Gifted 7000 dollars</h2>
                                <p className="summary-card-desc">17% increase from previous month</p>
                            </div>

                        </div>

                        {/* Visualizations */}
                        <h2>Visualizations</h2>
                        <p>Here are visualizations of all significant interactions that occurred this month:</p>

                        {/* Timeline */}
                        <h2>Important Timeline</h2>
                        <p>This is what happened right before this donor made the first gift:</p>

                        {/* Full Interaction History */}
                        <h2>Full Interaction History</h2>
                        <p>Here is a list of all the interaction this donor had with SeattleTeam:</p>
                    </div>


                </div>
            </div>
        </div>
    )
}

export default Profile;
